        return (
            <React.Fragment>
                <div className="row">

                    <div className="col-2">
                        <ListGroup items={this.state.movies} />
                    </div>

                    <div className="col">
                        <table className="table">
                            <thead>
                                <tr>
                                    <th>Title</th>
                                    <th>Genre</th>
                                </tr>
